import React, { useState, useEffect } from "react";

export const Pokemons = ({locationUrl}) => {
    
    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await fetch(locationUrl);
                const data = await response.json();
                console.log(data);
            } catch (err) {
                console.log(err)
            }
        }
        fetchData()
    }, [])

}
